function Estabelecimento(Props) {
  return (
    <>
      <img src={Props.url_img} alt="" />
      <br />
      <b>{Props.nome}</b> 
      <i class="fa-solid fa-star"></i><p>{Props.avaliacao} - Lanches</p>
      <br /><br />
    </>
  );
}

export default Estabelecimento;
